import React from 'react';
import Navbar from './components/Navbar/Navbar.jsx';
import HomePage from './components/Home/Home.jsx';
import AboutMe from './components/AboutMe/AboutMe.jsx';
import Projects from './components/Projects/Projects.jsx';
import ChatPage from './components/ChatAI/Chat.jsx';
import './App.css';
import { BrowserRouter } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <div className="app">
        {/* Navbar */}
        <nav className="navbar">
          <Navbar />
        </nav>

        {/* Animated Background */}
        <div className="wave-container">
          <svg
            className="wave"
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 0 1440 320"
          >
            <path
              fill="#f7e0af"
              fillOpacity="1"
              d="M0,192L60,202.7C120,213,240,235,360,229.3C480,224,600,192,720,176C840,160,960,160,1080,181.3C1200,203,1320,245,1380,266.7L1440,288L1440,320L1380,320C1320,320,1200,320,1080,320C960,320,840,320,720,320C600,320,480,320,360,320C240,320,120,320,60,320L0,320Z"
            ></path>
          </svg>
        </div>

        {/* Sections */}
        <div id="home" className="section">
          <HomePage />
        </div>

        <div id="aboutme" className="section">
          <AboutMe />
        </div>

        <div id="projects" className="section">
          <Projects />
        </div>

        <div id="chat" className="section">
          <ChatPage />
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
